    .setColor("BLUE")
    .setAuthor(msg.author.tag, msg.author.displayAvatarURL)
    .setDescription('The ticket has been closed by a member of the support team, if you feel like needing more support please dont hesitate to send the bot a message.')
    .setTimestamp();
    msg.channel.send(em);
    tuser.send(em);
    msg.channel.send("Deleting channel in 10 seconds..")
    setTimeout(function(){
        msg.channel.delete()
     }, 10000);
} else {
    const em = new DiscordJS.RichEmbed()
    .setColor("#FF0000")
    .setDescription("⚠ this is not a ticket!");
    msg.channel.send(em);
}

(async () => {
    const textt = msg.content
    if (msg.channel.type == 'dm') {
        const tserver = client.guilds.get('660809309458006027'); // Change 'ID' to the ID of your ticket server (do NOT remove quotes)
        const tcategory = tserver.channels.get('ID'); // Change '661148790555803650' to the ID of your ticket category (do NOT remove quotes)
        if (!tserver.channels.some(c => c.parent == tcategory && c.name.includes(msg.author.id))) {
            const tchannel = await tserver.createChannel(msg.author.id, {
                type: 'text',
                parent: tcategory
            });
            const emb = new DiscordJS.RichEmbed()
            .setColor("BLUE")
            .setDescription("Thank you for contacting the support team, there will be someone with you shortly");
            msg.author.send(emb);
            const em = new DiscordJS.RichEmbed()
            .setTitle("New Ticket")
            .setAuthor(msg.author.tag, msg.author.displayAvatarURL)
            .setColor("BLUE")
            .setDescription(textt)
            .setTimestamp();
            tchannel.send(em);
        } else {
            const tchannel = tserver.channels.find(c => c.name.includes(msg.author.id))
            const em = new DiscordJS.RichEmbed()
            .setAuthor(msg.author.tag, msg.author.displayAvatarURL)
            .setColor("BLUE")
            .setDescription(textt)
            .setTimestamp();
            tchannel.send(em);
        }
    } 
})()

